import ExpenseItem from "./component/ExpenseItem";
function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 123.45,
      date: new Date(2000, 10, 13),
    },
    {
      id: "e2",
      title: "Car Insurance",
      amount: 123.45,
      date: new Date(2000, 10, 13),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 123.45,
      date: new Date(2000, 10, 13),
    },
    {
      id: "e4",
      title: "Car Insurance",
      amount: 123.45,
      date: new Date(2000, 10, 13),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}

      ></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
